function App() {
  const ManejarBo = async () =>{
    // console.log('maikel esta aui')
    await fetch("https://jsonplaceholder.typicode.com/users/1")
    .then(res => {
      res.json()
    })
    .then(data => {
      console.log(data.data)
    })
  }
  return (
    <div className="App">
      <h1>Maikel</h1>
      <button onClick={ManejarBo}>Click!</button>
    </div>
  );
}

export default App;
